
syntax = "proto3";
option csharp_namespace = "Config";


message SubTest
{
	int32 ID = 1;
	int32 Test1 = 2;
	int32 Test2 = 3;
	int32 Test3 = 4;

}

message Test
{
	int32 ID = 1;
	repeated string ARRAY_TEST = 2;
	map<int32, SubTest> TEST = 3;
	SubTest ObjectTest = 4;
	repeated int32 ARRAY_NORMAL = 5;
	map<int32, int32> MAP_NORMAL = 6;

}


message DataHelper 
{
    repeated string messageType = 1;
	map<int32, SubTest> SubTest_dict = 2;
	map<int32, Test> Test_dict = 3;

}
